import React from 'react';
import Keyboard from './Keyboard';
import Board from './Containers/Board';

function Sudoku(){
    return (
        <>
            <div style={{ display: "grid",
                         gridTemplateColumns: "repeat(2, 1fr)", gridGap: 20 }}>
                <div>
                    <Board/>
                </div>
                <div>
                    <Keyboard/>
                </div>
            </div>
        </>
    )
}

export default Sudoku;
